import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
// Importa solo CognitivoView, ya que no necesitas MiVista
import CognitivoView from '../views/CognitivoView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/about',
    name: 'about',
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  },
  {
    path: '/cognitivoview',
    name: 'CognitivoView',  // Aquí usas correctamente el componente CognitivoView
    component: CognitivoView,  // Asegúrate de que uses CognitivoView aquí
  },
]

const router = new VueRouter({
  routes
})

export default router
